<?php
class Contact extends AppModel{

	
	function getStyle(){
	return '<style>
		img{max-width:100%;}
		body{color:#000;}
		p{padding:0%;}
		fieldset{width:80%;margin:auto;}
		legend{background:#fff;}
		table{margin:auto;}
		.att-getRegister{}
		.att-headers-report{text-align:right;border: 1px solid #000;font-size:70%;}
		.att-code-report{border: 1px solid #000;width: 5%;color: #000;text-align:center;empty-cells:show;}
		.deleteActivity{display:none;}
		.reports-targets{padding:1%;background:#000;color:#fff;font-weight:bold;font-size:100%;}
		.reports-table{
			width:100%;
			background:font-size:80%;
			border: 2px solid #777;
			margin:0% 0% 2% 0%;
			border-collapse:collapse;}
		.reports-table td{border: 1px solid #ccc;padding:0.4%;}
		.reports-fieldset{margin-bottom: 3% 0% 3% 0%;}
		.reports-activities-box{margin: 2%;border: 0px;}
		.reports-activities-box p{margin:0% 0% -0% -2%;}
		.report-table-left{text-align:left;width:60%;font-size:90%;}
		.report-table-right{text-align:center;width:15%;font-size:90%;}
		#reports-award{display:none;}		
	</style>';
	}
	
	function getFooterText($pupil_id){
		return "
		<hr />
		<p>If you have any questions or want to talk with a member of staff about ".ClassRegistry::init('Pupil')->getName($pupil_id)."'s report please contact the office<br />phone | 020 71882267<br />email | bmordan@evelina.southwark.sch.uk or kowens@evelina.southwark.sch.uk</p><p>Yours Sincerly</p><p>Evelina Hospital School</p>";
	}	
	
	function getCc($pupil_id){
		$cc = $this->find('list',array('conditions' => array('pupil_id'=>$pupil_id,'report'=>1),'fields'=>'email'));
		return $cc;
	}
	
	function getHeaderText($pupil_id,$from,$to){
		$name = ClassRegistry::init('Pupil')->getName($pupil_id);
		$gender = ClassRegistry::init('Pupil')->getGender($pupil_id);
		return '
			<div style="width:80%;margin:auto;"><img src="data:image/jpg;base64,"></div>



			<h2 style="text-align:center;">School Report for '.ClassRegistry::init('Pupil')->getName($pupil_id).'</h2>
			<h4 style="text-align:center;">Start date '.date('j F',strtotime(substr($from,1,-1))).' to '.date('j F Y',strtotime(substr($to,1,-1))).'</h4>
			<p>'.$name.' recently attended Evelina Hospital School. We are sending '.$gender.' attendance to you so that you can add it to your records. There are a few attendance marks that need some explaination. Firstly we use the "W" code to indicate a session '.$name.' might have recieved on the wards. We recorded '.$name.'\'s attendance at '.$gender.' home school with a "D", you can ignore these. Our attendance marks "/","\","W" should be entered on your registers as either "D" - Dual Registered or "B" - Educated Off-Site.</p>';
	}
	

	
}